commentary:
both sherds of well-fired hand-moulded ware, unadorned;
a) medium coarse sand in composition, slightly cracked surfaces, brownish and gray in color;
b) with a slightly finer composition than the previous one, surfaces with good processing, brown and gray in color; e.-v. triangular in shape

a) item no. e.-v. triangular in shape, piece of stud(?);
b) triangular-shaped ornament consisting of eyeballs and three rows of stud lines on one side, ornament worn, bracelet v. piece of ring;
c) loose, with compressed ends, of 0.2 cm thick round wire

